import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import VueRouter from 'https://unpkg.com/vue-router@4.0.15/dist/vue-router.global.js'

Vue.use(VueRouter);
Vue.config.productionTip = false
export const eventBus = new Vue({

  methods : {
    sendToData(menuData){
      this.$emit("pageData", menuData);
    }
  }
});
new Vue({
  vuetify,
  render: h => h(App)
}).$mount('#app')
